import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import { useState, useEffect } from 'react';
import "../CSS/Navbar.css";

function Navbar() {

    const [openMenu, setOpenMenu] = useState(false);

    // const location = useLocation();
    // useEffect(() => {
    //     setOpenMenu(false)
    // }, [location]);

    return (
        <div className='Navbar'>

            <div className='navItems'>

                <div>
                    <Link to="/" className='logo'>{"<JD/>"}</Link >
                </div>

                <div className='menuBtn'>
                    <button onClick={() => { setOpenMenu(!openMenu) }}>
                        <svg stroke="currentColor" fill="currentColor" strokeWidth="0" viewBox="0 0 20 20" height="1em" width="1em" xmlns="http://www.w3.org/2000/svg"><path fillRule="evenodd" d="M3 7a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1zM3 13a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1z" clipRule="evenodd"></path></svg>
                    </button>
                </div>

                <div className='pages' id={openMenu ? "open" : "close"}>
                    <Link to="https://resume.io/r/KfGTUy2KV" className='link'>Resume</Link>
                    <Link to="/projects" className='link'>Projects</Link >
                    <Link to="/Experience" className='link'>Experience</Link >

                    <button className='closeBtn link' onClick={() =>{
                        setOpenMenu(false)
                    }}><svg stroke="currentColor" fill="currentColor" stroke-width="0" viewBox="0 0 1024 1024" height="1em" width="1em" xmlns="http://www.w3.org/2000/svg"><path d="M685.4 354.8c0-4.4-3.6-8-8-8l-66 .3L512 465.6l-99.3-118.4-66.1-.3c-4.4 0-8 3.5-8 8 0 1.9.7 3.7 1.9 5.2l130.1 155L340.5 670a8.32 8.32 0 0 0-1.9 5.2c0 4.4 3.6 8 8 8l66.1-.3L512 564.4l99.3 118.4 66 .3c4.4 0 8-3.5 8-8 0-1.9-.7-3.7-1.9-5.2L553.5 515l130.1-155c1.2-1.4 1.8-3.3 1.8-5.2z"></path><path d="M512 65C264.6 65 64 265.6 64 513s200.6 448 448 448 448-200.6 448-448S759.4 65 512 65zm0 820c-205.4 0-372-166.6-372-372s166.6-372 372-372 372 166.6 372 372-166.6 372-372 372z"></path></svg></button>
                </div>

            </div>
        </div>
    )
}
export default Navbar;
